import React from 'react';
import {DashboardWrapper} from "../../styled/Dashboard.styled";
import DashboardNavigation from "../../components/DashboardNavigation";
import {AdminH1} from "../../styled/Common.styled";

function DashboardEditions() {
        return (
            <DashboardWrapper>
                <DashboardNavigation active={"home"}>
                    <AdminH1>Bienvenue, Mimoun.</AdminH1>
                </DashboardNavigation>
            </DashboardWrapper>
        );
}

export default DashboardEditions;
